import React from 'react'
import {Chart as classNamehartJs} from "chart.js/auto"
import {Bar,Dougnut,Line} from "react-chartjs-2"
import './App.css'
const App=()=>{
  return(
    <div className="chart">
      <div className="chart1">
        <Bar
        data={{
          labels:['A','B','C'],
          datasets:[
            {
              label:"revenue",
              data:[200,300,400]
            },
            {
              label:"loss",
              data:[70,80,90],
              backgroundColor:"red"
            },

          ]

        }}

        />
      </div>
      <div className="chart2">
        <Line
         data={{
          labels:['A','B','C'],
          datasets:[
            {
              label:"revenue",
              data:[20,12,15],
              backgroundColor:"blue",
              borderColor:"blue"
            },
            {
              label:"loss",
              data:[70,80,90],
              backgroundColor:"red"
            },

          ]

        }}

        />
      </div>
    </div>
  )}
  export default App
